      .Citycount-txt {
        letter-spacing: 4px;
        margin-left: 58%;
        font-size: 20px;
        text-shadow: -1px -1px 0 #a45313, 1px -1px 0 #a45313, -1px 1px 0 #a45313,
          1px 1px 0 #a45313;
      }

      .light {
        position: absolute;
        height: 10px;
        width: 10px;
        border-radius: 50%;
        top: 5px;
        left: 115px;
        transform-origin: 5px 115px;
      }

      .light-twinkling {
        animation: 1s twinkling 3, 100ms 3s twinkling 3;
      }

      .light:nth-child(2n) {
      }

      .light:nth-child(2n + 1) {
      }

      .light:nth-child(2) {
        transform: rotate(36deg);
      }

      .light:nth-child(3) {
        transform: rotate(72deg);
      }

      .light:nth-child(4) {
        transform: rotate(108deg);
      }

      .light:nth-child(5) {
        transform: rotate(144deg);
      }

      .light:nth-child(6) {
        transform: rotate(180deg);
      }

      .light:nth-child(7) {
        transform: rotate(216deg);
      }

      .light:nth-child(8) {
        transform: rotate(252deg);
      }

      .light:nth-child(9) {
        transform: rotate(288deg);
      }

      .light:nth-child(10) {
        transform: rotate(324deg);
      }

      }

      .Citypanel-box {
        width: 100%;
        height: 100%;
        overflow: hidden;
      }

      .sector {
        position: absolute;
        left: 100px;
        top: 0px;
        width: 100px;
        height: 200px;
        font-size: 14px;
        border-radius: 0px 100px 100px 0;
        overflow: hidden;
        transform-origin: left center;
      }

      .sector:nth-child(1) {
        transform: rotate(-45deg);
      }

      .sector:nth-child(2) {
        transform: rotate(0deg);
      }

      .sector:nth-child(3) {
        transform: rotate(45deg);
      }

      .sector:nth-child(4) {
        transform: rotate(90deg);
      }

      .sector:nth-child(5) {
        transform: rotate(135deg);
      }

      .sector:nth-child(6) {
        transform: rotate(180deg);
      }

      .sector:nth-child(7) {
        transform: rotate(225deg);
      }

      .sector:nth-child(8) {
        transform: rotate(270deg);
      }

      .sector:nth-child(2n + 1).sector-inner {
      }

      .sector:nth-child(2n).sector-inner {
      }

      .sector-inner {
        text-align: center;
        display: block;
        width: 40px;
        padding: 5px 3px 0 57px;
        height: 195px;
        transform: translateX(-100px) rotate(45deg);
        transform-origin: right center;
        border-radius: 100px 0 0 100px;
      }

      .sector-inner span {
        display: block;
        transform-origin: center;
        transform: rotate(-19deg);
        color: #d46854;
      }

      .Citypointer {
        display: none;
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        z-index: 10;
        height: 100px;
        width: 100px;
        padding: 6px;
        color: #fff899;
        line-height: 15px;
        font-size: 12px;
        text-align: center;
        transition: transform 3s cubic-bezier(0.2, 0.93, 0.99, 1);
      }

      .Citypointer-bg {
        margin: -11px auto;
        width: 20px;
        height: 80px;
        background-repeat: no-repeat;
        background-size: 100%;
        background-position: center;
      }

      .Cityresult {
        display: none;
        position: absolute;
        top: 0;
        left: 0;
        width: 100vw;
        height: 100vh;
      }

      .Cityresult-box {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        width: 100vw;
        height: 100vh;
        color: #fff;
        font-size: 26px;
        background-color: rgba(0, 0, 0, 0.8);
      }

      .Cityresult img {
        width: 48%;
        height: 90%;
      }

      @keyframes twinkling {
        50% {
          background: transparent;
        }
      }

      .Egito-City-container-box {
        position: relative;
        display: flex;
        justify-content: center;
        width: 100%;
        height: 100%;
        background-size: 100%;
        background-position: center;
      }

      .Egito-City-container {
        position: relative;
        margin-top: 9%;
        margin-left: -2%;
        display: flex;
        justify-content: space-evenly;
        width: 76%;
        height: 74%;
      }

      .Egito-box {
        flex: 1;
        max-width: 22%;
        margin-top: -1%;
        height: 103%;

        overflow: hidden;
      }
      .Egito-box:nth-child(2) {
        margin-right: 20%;
      }
      .Egito-img {
        margin-bottom: 8%;
        display: flex;
        justify-content: center;
      }

      .starlightrandomImages {
        animation: image-animation 2s;
        transform: translateY(-80%);
      }

      .Egito-img img {
        margin: 0 0 0 9%;
        width: 73%;
        height: 100%;
      }

      @keyframes image-animation {
        0% {
          transform: translateY(0);
        }

        100% {
          transform: translateY(-80%);
        }
      }
    </style>
